import FilterCmd from "./FilterCmd";
import "../contents/Content.css";
import data from "../selectpage/Data3";
import Nav from "../navbar/Nav";

function Filter() {
  let i = 0;
  let j = 0;
  const properties = data.properties;
  let ind = useLocation();
  return (
    <div>
      <Nav />
      <FilterCmd ind={ind} />
    </div>
  );
}
export default Filter;
